import React from 'react';


const AdminLogin = () => {

	return (

		<html>
			<head>
				<title>Admin Login</title>
			</head>

			<body>
				<form action="">

					<label for="username">Username:</label>
					<input type="text" name="username" required="required"></input>

				</form>
			</body>
		</html>


	);
};

export default AdminLogin;
